import React from 'react';
import './App.css';
import {Container, Tabs, Tab, AppBar} from "@mui/material";
import {Projects} from './views/Projects/Projects';
import {Link, BrowserRouter, Route, Routes} from 'react-router-dom';
import {Switch} from 'react-router';


function App() {

  return (
          <Container maxWidth="sm">
              <BrowserRouter>
                  <Routes>
                      <Route path="/"
                         render={(history) =>(
                             <AppBar>
                                 <Tabs value={history.location.pathname}>
                                     <Tab
                                         label="Home"
                                         value={"/home"}
                                         component={Link}
                                         to={"/home"}
                                     />
                                     <Tab
                                         label="Projects"
                                         value={"/projects"}
                                         component={Link}
                                         to={"/projects"}
                                     />
                                 </Tabs>
                             </AppBar>
                         )}
                      />
                   </Routes>
              </BrowserRouter>

          </Container>

  );
}

export default App;

